var ultima4 = {};

ultima4.gameData = (function() {
  var tiles = "data:image/png;base64,";

  var rleMapData = "";

  var font = "";

  var townMaps = "";

  function rleDecode(data) {
    var buf = "";
    for (var i=0; i<data.length; i++) {
      var c = data.charCodeAt(i);
      if (c >= 128) {
        var code = c & 7;
        var n = (c>>3) & 15;
        for (var j=0; j<n; j++)
          buf += String.fromCharCode(code);
      } else {
        buf += String.fromCharCode(c);
      }
    }
    return buf;
  }

  return {
    tiles: tiles,
    worldMap: rleDecode(atob(rleMapData)),
    font: font,
    townMaps: townMaps 
  };
}());

ultima4.main = (function() {
  function getTileAt(x, y, town) {
    return typeof town == "undefined" || town == null ? 
      getMapTileAt(x, y) : 
      getTownTileAt(x, y, town);      
  }

  function getMapTileAt(x, y) {
    return worldMap.charCodeAt(y*256+x);
  }

  function getTownTileAt(x, y, town) {
    return (x>=0 && x<32 && y>=0 && y<32) ?
      parseInt(townMaps.substr(town*1024*2 + y*32*2 + x*2, 2), 16) :
      4;
  }

  function drawChar(g, c, fgColor, bgColor, x, y) {
    if(c>=0 && c<=127) {
      for (var row=0; row<8; row++) {
        var b =  parseInt(ultima4.gameData.font.substr(c*8*2 + row*2, 2), 16);
        for (var i=7; i>=0; i--) {
          g.fillStyle = (b & (1<<i)) ? fgColor : bgColor;
          g.fillRect(x+8*2-(i+1)*2, y+row*2, 2, 2);
        }        
      }
    }
  }

  function drawText(g, s, fgColor, bgColor, x, y) {
    for (var i=0; i<s.length; i++) 
      drawChar(g, s.charCodeAt(i), fgColor, bgColor, x+i*8*2, y);
  }

  function drawCharLine(g, c, fgColor, bgColor, x, y, dx, dy, n) {
    for(var i=0; i<n; i++, x+=dx, y+=dy) 
      drawChar(g, c, fgColor, bgColor, x, y);
  }

  function drawTile(g, tile, x, y) {
    g.drawImage(tiles, (tile%16)*16, Math.floor(tile/16)*16, 16, 16, x, y, 32, 32);
  }

  function drawViewport(g, mapX, mapY, town) {
    var ox = 16 + 5*32;
    var oy = 16 + 5*32;
    for (var y=-5; y<=5; y++) {
      for (var x=-5; x<=5; x++) {
        var  tile = !isTileInLineOfSight(x, y, town) ? tileType.empty : getTileAt(mapX+x,mapY+y,town);
        drawTile(g, tile, ox + x*32, oy + y*32);
      }
    }

    drawTile(g, 31, ox, oy);

    function isTileInLineOfSight(x, y, town) {
      var blockingTiles = numberOfSightBlockersOnLine(0, 0, x, y, town);
      if (blocksView(getTileAt(mapX+x,mapY+y,town)) && blockingTiles <= 1) {
        return true;
      } else {
        return blockingTiles == 0;
      }
    }

    function blocksView(tile) {
      return [tileType.mountain, tileType.forest, tileType.wall].indexOf(tile) != -1;
    }

    function numberOfSightBlockersOnLine(x0, y0, x1, y1, town) {
      var origX1 = x1;
      var origY1 = y1;
      var steep = Math.abs(y1-y0) > Math.abs(x1-x0);
      if (steep) {
        var tmp = x0;
        x0 = y0;
        y0 = tmp;
        tmp = x1;
        x1 = y1;
        y1 = tmp;
      }

      if (x0 > x1) {
        var tmp = x0;
        x0 = x1;
        x1 = tmp;
        tmp = y0;
        y0 = y1;
        y1 = tmp;
      }

      var deltaX = x1 - x0;
      var deltaY = Math.abs(y1 - y0);
      var error = 0;
      var deltaError = deltaY/deltaX;
      var ystep = (y0 < y1) ? 1 : -1;
      var y = y0;
      var blockingTiles = 0;
      for (var x=x0; x<=x1; x++) {
        var tile = steep ? getTileAt(mapX+y,mapY+x,town) : getTileAt(mapX+x,mapY+y,town);
        if (!(y == 0 && x == 0) && blocksView(tile)) {
          blockingTiles += 1;
        }
        error = error + deltaError;
        if (error >= 0.5) {
          y += ystep;
          error -= 1.0;
        }
      }
      return blockingTiles;
    }
  }

  function drawScreenFrames(g) {
    drawTopRow();
    drawLeftColumn();
    drawBottomRow();
    drawCenterColumn();
    drawRightColumn();
    drawRightSideHorizontalBars();

    function drawTopRow() {
      drawChar(g, 16, palette[14], palette[0], 0, 0);
      drawCharLine(g, 4, palette[14], palette[1], 16, 0, 16, 0, 9);
      drawChar(g, 30, palette[14], palette[0], 10*16, 0);
      drawChar(g, 28, palette[14], palette[0], 13*16, 0);
      drawCharLine(g, 4, palette[14], palette[1], 14*16, 0, 16, 0, 9);
      drawChar(g, 0, palette[14], palette[0], 23*16, 0);
      drawCharLine(g, 4, palette[14], palette[1], 24*16, 0, 16, 0, 15);
      drawChar(g, 18, palette[14], palette[0], 39*16, 0);
    }

    function drawLeftColumn() {
      drawCharLine(g, 10, palette[14], palette[1], 0, 16, 0, 16, 22);
      drawChar(g, 20, palette[14], palette[0], 0, 23*16);
    }

    function drawBottomRow() {
      drawCharLine(g, 2, palette[14], palette[1], 16, 23*16, 16, 0, 5);
      drawChar(g, 30, palette[14], palette[0], 6*16, 23*16);
      drawChar(g, 28, palette[14], palette[0], 17*16, 23*16);
      drawCharLine(g, 2, palette[14], palette[1], 18*16, 23*16, 16, 0, 5);
    }

    function drawCenterColumn() {
      drawCharLine(g, 12, palette[14], palette[1], 23*16, 16, 0, 16, 8);
      drawChar(g, 8, palette[14], palette[1], 23*16, 9*16);
      drawChar(g, 12, palette[14], palette[1], 23*16, 10*16);
      drawChar(g, 8, palette[14], palette[1], 23*16, 11*16);
      drawCharLine(g, 12, palette[14], palette[1], 23*16, 12*16, 0, 16, 11);
      drawChar(g, 10, palette[14], palette[1], 23*16, 23*16);
    }

    function drawRightColumn() {
      drawCharLine(g, 8, palette[14], palette[1], 39*16, 16, 0, 16, 8);
      drawChar(g, 0, palette[14], palette[1], 39*16, 9*16);
      drawChar(g, 8, palette[14], palette[1], 39*16, 10*16);
    }

    function drawRightSideHorizontalBars() {
      drawCharLine(g, 6, palette[14], palette[1], 24*16, 9*16, 16, 0, 15);
      drawCharLine(g, 6, palette[14], palette[1], 24*16, 11*16, 16, 0, 15);
      drawChar(g, 4, palette[14], palette[1], 39*16, 11*16);
    }
  }

  function repaint() {
    var g = canvas.getContext("2d");
    g.fillStyle = '#000';
    g.fillRect(0, 0, canvas.width, canvas.height);
    drawScreenFrames(g);
    drawViewport(g, state.x, state.y, state.town);
    drawText(g, "1-TSU      125G", palette[1], palette[0], 24*16, 1*16);
    drawText(g, "2-MKA      125G", palette[1], palette[0], 24*16, 2*16);
    drawText(g, "F:0200   G:0200", palette[1], palette[0], 24*16, 10*16);
    drawText(g, "WIND SOUTH", palette[1], palette[0], 7*16, 23*16);
    console.draw(g);
  }

  function mutateNorth(state) {
    return { x: state.x, y: state.y - 1 };
  }

  function mutateEast(state) {
    return { x: state.x + 1, y: state.y };
  }

  function mutateSouth(state) {
    return { x: state.x, y: state.y + 1 };
  }

  function mutateWest(state) {
    return { x: state.x - 1, y: state.y };
  }

  function moveCommand(mutator, displayName) {
    return function() {
      var s = displayName;
      var newState = mutator(state);
      if (canMoveTo(newState.x, newState.y, state.town)) {
        state.x = newState.x;
        state.y = newState.y;
      } else {
        s += "\nBLOCKED!";
      }
      console.pushCommand(s);
    };

    function canMoveTo(mapX, mapY, town) {
      return tilesCanWalkOn.indexOf(getTileAt(mapX, mapY, town)) != -1;
    }
  }

  function padStringCenter(s, len) {
    if (typeof len == "undefined")
      len = 15;
    if(s.length < len)
      for(var i=(len - s.length)/2; i>0; i--)
        s = " " + s;
    return s;
  }

  function commandEnter() {
    var s = "Enter ";    
    if(state.town == null) {
      var loc = getLocation(state.x, state.y);
      var type = getTileAt(state.x, state.y, state.town);
      window.console.log("location: "+ loc);
      if(loc) {
        state.town = loc.id;
        switch (type) {
        case tileType.town:
          state.x = 1;
          state.y = 15;
          s += "towne!";
          break;
        case tileType.LBCastleCenter:
          state.x = 15;
          state.y = 30;
          s += "castle!";
          break;
        }
        s += "\n\n" + padStringCenter(loc.name);
      } else
        s += "WHAT?";
    } else
      s += "WHAT?";
    console.pushCommand(s);
  }
  
  function commandOpen() {
    console.pushCommand("Open-");
  }

  function keyDown(e) {
    var command = commands[e.keyCode];
    if (command) {
      command();     
    } else
      console.pushCommand("WHAT?");
    repaint();
  }

  function createCanvas() {
    var canvas = document.createElement("canvas");
    canvas.width = 320*2;
    canvas.height = 200*2;
    return canvas;
  }

  function createConsole() {
    var maxLines = 11;
    var width = 15;
    var lines = new Array();
    var promptCode = 30;
    var cursorCode = 125;
    var prompt = String.fromCharCode(promptCode);
    var cursor = String.fromCharCode(cursorCode);

    function pushText(str) {
      str.split("\n").forEach(function(s) {        
        if (lines.push(s) > maxLines) 
          lines.shift();
      });
    }

    function pushCommand(s) {
      pushText(prompt + s +"\n");
    }

    function drawPrompt(g) {
      drawChar(g, promptCode, palette[14], palette[0], 24*16, (12+lines.length)*16);
      drawChar(g, cursorCode, palette[1], palette[0], 25*16, (12+lines.length)*16);
    }

    function draw(g) {
      for (var i=0; i<lines.length; i++) {
        var s = lines[i];
        if(s.charCodeAt(0) == promptCode) {
          drawChar(g, promptCode, palette[14], palette[0], 24*16, (12+i)*16);
          drawText(g, s.substr(1), palette[1], palette[0], 25*16, (12+i)*16);
        } else {
          drawText(g, s, palette[1], palette[0], 24*16, (12+i)*16);
        }
      }
      drawPrompt(g);
    }

    return {
      pushText: pushText,
      pushCommand: pushCommand,
      draw: draw
    };
  }

  function createTiles() {
    var tiles = new Image();
    tiles.src = ultima4.gameData.tiles;
    tiles.onload = onFinishedLoading;
    return tiles;
  }

  function onFinishedLoading() {
    console.pushText("Welcome to");
    console.pushText("Ultima IV");
    console.pushText("");
    repaint();
  }

  function getLocation(x, y) {
    var hit = locations.filter(function(p){ return p.location.x==x && p.location.y==y });
    return hit ? hit[0] : null;
  }

  var keys = {
    up: 38,
    left: 37,
    down: 40,
    right: 39,
    E: "E".charCodeAt(0),
    O: "O".charCodeAt(0)
  };

  var tileType = {
    deepOcean: 0,
    ocean: 1,
    river: 2,
    swamp: 3,
    grass: 4,
    bushes: 5,
    forest: 6,
    hill: 7,
    mountain: 8,
    dungeon: 9,
    town: 10,
    castle: 11,
    village: 12,
    LBCastleLeft: 13,
    LBCastleCenter: 14,
    LBCastleRight: 15,
    stoneBridge: 0x17,
    woodenBridgeTop: 0x19,
    woodenBridgeBottom: 0x1a,
    ladderUp: 0x1b,
    ladderDown: 0x1c,
    ruins: 0x1d,
    shrine: 0x1e,
    stoneFloor: 0x3e,
    woodenfloor: 0x3f,
    empty: 69,
    wall: 0x7f
  };

  var tilesCanWalkOn = [tileType.swamp, tileType.grass, tileType.bushes, tileType.forest, tileType.hill, tileType.dungeon, tileType.town, tileType.castle, tileType.village, tileType.LBCastleCenter, tileType.stoneFloor, tileType.woodenFloor, tileType.stoneBridge, tileType.woodenBridgeTop, tileType.woodenBridgeBottom, tileType.ruins, tileType.shrine];
  var state = {
    x: 86,
    y: 108,
    town: null,
    readInput: null
  };

  var palette = ["#000000", "#FDFEFC", "#BE1A24", "#30E6C6",
                 "#B41AE2", "#1FD21E", "#211BAE", "#DFF60A", 
		 "#B84104", "#6A3304", "#FE4A57", "#424540",
		 "#70746F", "#59FE59", "#5F53FE", "#A4A7A2"];

  var console = createConsole();
  var worldMap = ultima4.gameData.worldMap;
  var tiles = createTiles();
  var townMaps = ultima4.gameData.townMaps;
  var canvas = createCanvas();
  var commands = (function() {
    var map = {};
    map[keys.up] = moveCommand(mutateNorth, "North");
    map[keys.right] = moveCommand(mutateEast, "East");
    map[keys.down] = moveCommand(mutateSouth, "South");
    map[keys.left] = moveCommand(mutateWest, "West");
    map[keys.E] = commandEnter;
    map[keys.O] = commandOpen;
    return map;
  }());


  var locationNames = [
    "BRITANNIA", "THE LYCAEUM", "EMPATH ABBEY", "SERPANTS HOLD",
    "MOONGLOW", "BRITAIN", "JHELOM", "YEW", "MINOC",
    "TRINSIC", "SKARA BRAE", "MAGINCIA", "PAWS",
    "BUCCANEERS DEN", "VESPER", "COVE", 
    "DECEIT", "DESPISE", "DASTERD", "WRONG",
    "COVETOUS", "SHAME", "HYLOTHETHE", 
    "GREAT\nSTYGIAN ABYSS!"];
  
  var locations = [
    { id: 0, location: { x: 86, y: 107 }, name: "BRITANNIA" },
    { id: 5, location: { x: 82, y: 106 }, name: "BRITAIN" }
  ]

  document.write("<body>");
  document.onkeydown = keyDown;
  document.body.appendChild(canvas);
}());